import XCTest
import UIKit
import Kingfisher

@testable import CatchMate
final class ImageStringDecodingTest: XCTestCase {
    let imageString = ""
    
    func testImageStringDecoding() {
        let result = ProfileImageHelper.processString(imageString)
        print("--------------Test: \(result)")
        XCTAssertNotNil(result, "변환이 실패하면 안 됩니다.")
    }
    
    func testIsBase64() {
        let result = ProfileImageHelper.isBase64Encoded(imageString)
        print("Test: \(result)")
        XCTAssertTrue(result, "Base64 Encoded String이 아니면 안 됩니다.")
    }
}
